typedef int (*zselect1_t)(const c128* w);
typedef int (*zselect2_t)(const c128* alpha, const c128* beta);

static inline f64 cabs1(c128 z)
{
    return fabs(creal(z)) + fabs(cimag(z));
}

static inline f64 cabs2(c128 z)
{
    return fabs(creal(z) / 2.0) + fabs(cimag(z) / 2.0);
}

